import React from "react";
import logo from './logo.svg';
import './App.css';
import Menubar from "./template/Menubartemplate.js";

function App() {
  const [data, setData] = React.useState(null);
  const [fibonacci, setFibonacci] = React.useState([]);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
    fetch("/fibonacci")
    .then((res) => res.json())
      .then((data) => {
        setFibonacci(data);       
      })
  }, []);

  return (
    <div className="App">
      <Menubar />
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>{!data ? "Loading..." : data}</p>
        <p>
          {fibonacci.fibonacci}
        </p>
      </header>
    </div>
  );
}

export default App;
